      mVue.countNewRequest = res;
      console.log(res);
    }
  });
}

var uu;

function f() {
  $.ajax({
    url: '/search',
    type: 'post',
    success: function success(res) {
      var msg = JSON.stringify(res);
      msg = $.parseJSON(msg);
      uu = msg;
      console.log(res);
      mVue.formValidate.sno = res.sno;

      if (res.sname == null) {
        active("新用户!", "请完善你的个人信息");
      } else {
        active(msg.sname);
      }
    }
  });
}

var mVue = new Vue({
  el: '#app',
  data: function data() {
    var validatePhone = function validatePhone(rule, value, callback) {
      if (!value) {
        return callback(new Error('手机号不能为空'));
      } else if (!/^1[34578]\d{9}$/.test(value)) {
        callback('手机号格式不正确');
      } else {
        callback();
      }
    };

    return {
      countMsg: '',
      countNewRequest: '',
      message: '',
      info: '',
      isCollapsed: false,
      choose: '',
      isdisabled: true,
      formValidate: {
        sno: '',
        sname: '',
        age: '',
        scall: '',
        collage: '',
        major: '',
        sclass: '',
        gender: '',
        birth: ''
      },
      ruleValidate: {
        name: [{
          required: true,
          message: '姓名不能为空',
          trigger: 'blur'
        }],
        age: [{
          required: true,
          message: '年龄不能为空',
          trigger: 'blur'
        }],
        call: [{
          required: true,
          validator: validatePhone,
          trigger: 'blur'
        }],
        collage: [{
          required: true,
          message: '请选择学院',
          trigger: 'change'
        }],
        major: [{
          required: true,
          message: '请选择专业',
          trigger: 'change'
        }],
        sclass: [{
          required: true,
          message: '请选择班级',
          trigger: 'change'
        }],
        gender: [{
          required: true,
          message: '请选择性别',
          trigger: 'change'
        }],
        date: [{
          required: true,
          type: 'date',
          message: '请选择日期',
          trigger: 'change'
        }]
      }
    };
  },
  computed: {
    menuitemClasses: function menuitemClasses() {
      return ['menu-item', this.isCollapsed ? 'collapsed-menu' : ''];
    },
    isdisabledFn: function isdisabledFn() {
      if (uu.sname != null) {
        this.formValidate.sname = uu.sname;
        this.formValidate.age = uu.sage;
        this.formValidate.scall = uu.scall;
        this.formValidate.collage = uu.collage;
        this.formValidate.major = uu.major;
        this.formValidate.sclass = uu.sclass;
        this.formValidate.birth = uu.birth;
        this.formValidate.gender = uu.gender;
        return this.isdisabled = true;
      } else {
        return this.isdisabled = false;
      }
    }
  },
  methods: {
    time1: function time1(e) {
      this.formValidate.birth = e;
    },
    change: function change() {
      mVue.choose = "xxx";
    },
    handleSubmit: function handleSubmit(name) {
      var _this = this;

      this.$refs[name].validate(function (valid) {
        if (valid) {
          _this.$Message.success('Success!');
        } else {
          _this.$Message.error('Fail!');
        }
      });
      var userInfo = this.formValidate;
      $.ajax({
        url: '/perfectInfo',
        type: 'post',
        contentType: "application/json;charset=UTF-8",
        data: JSON.stringify(userInfo),
        success: function success(res) {
          if (res === "ok") {
            //请求的是ｃｏｎｔｒｏｌｌｅｒ层
            window.location.href = "moreInfo";
          }
        }
      });
      console.log(JSON.stringify(userInfo));
    },
    handleReset: function handleReset(name) {
      this.$refs[name].resetFields();
    }
  }
});
